import React from 'react'
import '../css/TodoActionBar.css'

class TodoActionBar extends React.Component {
    render() {
        return (
            <div id="action-bar">
                <input type="text" id="text-box" placeholder="Write something to add" />
                <button id="btn-add" className="input-button">Add</button>
                <button id="btn-select-all" className="input-button">Select/Deselect All</button>
                <button id="btn-delete-selected" className="input-button">Delete Selected</button>
                <button id="btn-delete-completed" className="input-button">Delete Completed</button>
            </div>
        );
    }
}

export default TodoActionBar;
